INSERT INTO `posts` (`id`, `title`, `description`, `content`, `avartar`, `date_create`, `slug`, `status`, `id_category`) VALUES
(10, 'Xử phúc thẩm vụ ly hôn của vợ chồng Trung Nguyên', 'TP HCMSáng 18/9, TAND Cấp cao xem xét đơn kháng cáo xin đoàn tụ của bà Lê Hoàng Diệp Thảo và yêu cầu chia lại tài sản của ông Đặng Lê Nguyên Vũ.', '<p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Bà Diệp Thảo (46 tuổi) là nguyên đơn, có hai người đại diện là ông Đặng Ngọc Hoàng Hưng và Hoàng Anh Tuấn; 5 luật sư bảo vệ là Lê Thành Kính, Lê Thị Hoài Giang, Đoàn Thị Hồng Trang, Phạm Công Hùng và Lê Thị Kim Liên.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Đại diện cho bị đơn - ông Nguyên Vũ (48 tuổi, Chủ tịch kiêm Tổng giám đốc Công ty Cổ phần Tập đoàn Trung Nguyên) là bà Lê Thị Ước (mẹ ông Vũ) và luật sư Nguyễn Chính. Bảo vệ quyền và lợi ích hợp pháp cho ông là các luật sư Trương Thị Hòa, Hoàng Hữu Nhân, Nguyễn Minh Tâm.</p><table class=\"tplCaption\" cellspacing=\"0\" cellpadding=\"3\" border=\"0\" align=\"center\" style=\"margin: 10px auto; padding: 0px; text-rendering: geometricprecision; max-width: 100%; color: rgb(51, 51, 51); font-family: arial; width: 500px;\"><tbody style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><tr style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><td style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; line-height: 0;\"><img alt=\"Vợ chồng bà Thảo, ông Vũ tại phiên xử sơ thẩm. Ảnh: Thành Nguyễn.\" data-natural-h=\"304\" data-natural-width=\"500\" src=\"https://i-vnexpress.vnecdn.net/2019/09/17/Vu-Thao-2-2400-1568728552.jpg\" data-width=\"500\" data-pwidth=\"500\" style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; border: 0px; font-size: 0px; line-height: 0; max-width: 100%;\"></td></tr><tr style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><td style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; line-height: 0;\"><p class=\"Image\" style=\"padding: 10px; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: 16px; background: rgb(245, 245, 245);\">Bà Thảo, ông Vũ tại phiên xử sơ thẩm. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Thành Nguyễn.</em></p></td></tr></tbody></table><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Bà Thảo và ông Vũ có 4 con. Năm 2015, bà đơn phương ly hôn vì vợ chồng xảy ra nhiều mâu thuẫn. Bà đề nghị nuôi tất cả con, ông Vũ cấp dưỡng. Riêng về tài sản chung là tiền vàng ngoại tệ tại ngân hàng bà yêu cầu không đưa vào giải quyết trong vụ án. Còn cổ phần tại các công ty, bà đề nghị hưởng 51% (ước tính 2.114 tỷ đồng) trong Công ty Cổ phần Đầu tư Trung Nguyên - công ty nòng cốt chiếm phần lớn giá trị của tập đoàn...</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Phía ông Vũ đề nghị tòa tuyên được hưởng 70% tài sản tại các ngân hàng cũng như giá trị cổ phần tại tất cả các công ty thuộc Tập đoàn Trung Nguyên và sẽ thanh toán lại cho bà Thảo bằng tiền mặt đối với số cổ phần còn lại.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">TAND TP HCM mở 10 phiên hòa giải nhưng hai bên không tìm được tiếng nói chung. Hồi cuối tháng 3 xử sơ thẩm, toà chấp nhận cho vợ chồng bà Thảo ly hôn, ghi nhận sự thỏa thuận của hai bên về việc chia bất động sản, giao các con cho bà Thảo nuôi dưỡng, ông Vũ cấp dưỡng 10 tỷ đồng mỗi năm.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Đối với tài sản còn lại, HĐXX tuyên ông Vũ được sở hữu 60%, nắm quyền điều hành Trung Nguyên và có nghĩa vụ trả lại bà Thảo bằng tiền tương ứng với số cổ phần bà sở hữu. Theo HĐXX, ông Vũ \"có công lớn hơn\" và việc giao công ty cho ông Vũ điều hành là có tính đến lợi ích lâu dài của doanh nghiệp.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Bà Thảo kháng cáo toàn bộ bản án, cho rằng tại tòa bà đã nhiều lần tuyên bố ý chí rút đơn khi được HĐXX và VKS hỏi nhưng tòa vẫn tiếp tục xử và cho ly hôn là \"cưỡng ép\", không cho gia đình bà được đoàn tụ. Việc tòa buộc bà phải giao toàn bộ cổ phần mình sở hữu cho ông Vũ và nhận lại bằng tiền là tước đoạt quyền sở hữu của một cổ đông lớn đối với số cổ phần và phần vốn góp trong tập đoàn.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Bà Thảo cũng nói tòa sơ thẩm còn có nhiều vi phạm tố tụng, thiên vị ông Vũ khi đánh giá ông có công sức đóng góp nhiều hơn trong việc tạo lập khối tài sản chung... Từ các lý do trên, bà đề nghị toà phúc thẩm tuyên hủy án sơ thẩm.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Còn phía ông Vũ kháng cáo đề nghị cấp phúc thẩm chia phần tài sản chưa thỏa thuận được theo tỷ lệ ông 70%, bà Thảo 30%. VKS cũng có kháng nghị chỉ ra nhiều vi phạm của tòa sơ thẩm đề nghị cấp phúc thẩm hủy toàn bộ bản án.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\">Phiên phúc thẩm dự kiến kéo dài trong nhiều ngày.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal; text-align: right;\"><strong style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Hải Duyên</strong></p>', 'data:image/jpeg;base64,', '1568780554680', 'xu-phuc-tham-vu-ly-hon-cua-vo-chong-trung-nguyen188120191568767899964xu-phuc-tham-vu-ly-hon-cua-vo-chong-trung-nguyen', 1, 2);
INSERT INTO `posts` (`id`, `title`, `description`, `content`, `avartar`, `date_create`, `slug`, `status`, `id_category`) VALUES
(13, 'Trí tuệ của con người', 'Tôi đọc sách để tìm thấy một tiếng nói nào đó để an ủi nỗi cô đơn của một kẻ bị trôi dạt một cách cưỡng bức ra khỏi khát vọng của mình.', '<p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Khi tôi đi thanh niên xung phong, mẹ cho tôi hai bộ quần áo, một cái túi du lịch Trung Quốc và 20 đồng. Tôi ra Tràng Tiền mua hết 20 đồng tiền sách.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Tôi vẫn còn nhớ như in, thứ nhất là&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Tuyển tập kịch Shakespeare</em>&nbsp;được dịch bởi giáo sư Bùi Ý và cháu ông là Bùi Phụng. Tôi thuộc lòng những dòng tâm sự của Hamlet, những đau khổ của Othenlo, những giận dỗi và đểu giả của Macbeth, những toan tính của Coriolanus... tất cả đã trở thành đời sống tinh thần của tôi. Thứ hai là bộ sách&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Chiến tranh và Hoà bình</em>&nbsp;do giáo sư Cao Xuân Hạo dịch. Thứ ba là&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Bài ca sư phạm&nbsp;</em>của Makarenko và một vài bộ sách nữa.&nbsp;</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Những năm tôi đi lính, trong ba lô của tôi, quần áo ít hơn sách. Có người thắc mắc, tại sao những năm ấy mà tôi lại biết Shakespeare, Makarenko, Lev Tolstoi. Khi nào sống trong nghèo khổ và cô đơn thì chúng ta sẽ hiểu, chỉ cần một giọt chữ thôi cũng có thể làm dịu được nỗi đau khổ của cuộc đời.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Tôi có cả bộ ba tiểu thuyết của Marxim Gorky:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Thời thơ ấu, Kiếm sống và Những trường đại học của tôi</em>. Khi đọc Marxim Gorky tôi cảm thấy sự nghèo khổ hay sự đau khổ của mình gần giống với nỗi đau khổ của cậu bé Peskov - Marxim Gorky lúc còn bé. Có một sự đồng cảm, đồng điệu nào đó giữa tôi và cậu bé Peskov. Tất cả những chuyện đó làm dịu bớt nỗi đau của tôi. Tôi không ham mê văn học như là một người đã biết rõ giá trị của các tác phẩm ấy, tôi ham mê văn học như câu chuyện Robinson Crusoe phải dạy cho con vẹt biết nói để mình nghe thấy tiếng người không chỉ phát ra từ miệng mình. Tôi đọc sách để tìm thấy một tiếng nói nào đó để an ủi nỗi cô đơn của một kẻ bị trôi dạt một cách cưỡng bức ra khỏi khát vọng của mình.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Con người đã trở thành một thực thể thông tin trong thế giới ngày nay. Qua quan sát và nghiên cứu, tôi đã rút ra một kết luận: thông tin có được đối với mỗi người không phải chỉ bằng việc đọc mà nó được \"hút\" vào miền ký ức, vào tiềm thức của mình bằng tình yêu đối với nó. Và khi ấy, thông tin mới trở thành sức sống của mình.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Không có thông tin thì không mô phỏng được đời sống thật. Nhiều người cứ tưởng rằng mình có kinh nghiệm, mình từng trải, mình ra đường là thấy ngay các vấn đề của cuộc sống. Nhưng không phải thế. Người ta tạo ra hình tượng Phật bà nghìn mắt nghìn tay là để mô tả một cách thức con người nhận thức thế giới, tức là nhìn bằng một nghìn mắt và sờ bằng một nghìn tay. Sách và báo chí là công cụ nhìn và sờ của xã hội. Thiếu những thứ đó, bạn giống như đang ở tầng 10 mà cuộc sống thì ở tầng 1.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Với Internet, nhiều người trong xã hội, nhất là những người trẻ, có xu hướng ngại đọc sách, vì ngại mất thời gian, trong khi đó chỉ cần vài động tác là có thể kiếm được rất nhiều thông tin trên mạng. Trong một buổi nói chuyện với sinh viên, có bạn hỏi tôi, \"có những người đi làm như bố mẹ cháu do bận rộn nên một năm có khi chỉ đọc một quyển sách\". Và người ta còn rất nhiều lý do để biện minh. Có người nói trên mạng rất nhiều thông tin mới, nếu chỉ đọc sách cũ thì không cập nhật được. \"Chú có thấy điều đó đúng không?\". Tôi trả lời rằng cách giải thích như vậy nghe thì thông minh nhưng không đúng.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Ta biết rằng người ta đang sản xuất ra rất nhiều loại phân bón để kích thích lá mọc nhưng không kích thích rễ. Khi lá trên cây nhiều quá mà rễ không đủ thì đấy là cơ thể sống nhân tạo chứ không phải là cơ thể tự nhiên. Cho nên, bận gì thì bận, chúng ta cũng không được quên nuôi bộ rễ.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Đọc sách là để nuôi bộ rễ, còn đọc những thông tin mới trên truyền thông là để nuôi bộ lá, và phải cân bằng giữa lá và rễ, đấy chính là sự cân bằng tự nhiên. Thông tin hàng ngày cũng giống như cái áo mặc xong là vứt. Và như thế nó không tạo ra cái cây, không tạo ra cơ thể, tức là không tạo ra một chỉnh thể về mặt trí tuệ.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Bây giờ, tôi nhớ đến những quyển sách cũ như nhớ đến những người bạn, như nhớ đến một thứ gì đó cố tri. Lúc nhỏ đọc truyện&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Không gia đình</em>&nbsp;của Hector Malot, tôi thấy những quyển sách đi cùng với tôi và tuổi thanh niên của tôi giống hệt như là sự gắn bó của mấy đứa trẻ mồ côi, của cậu bé Remi và cậu bé Matchia nghèo khổ. Nếu đọc Tolstoi, người ta thấy Tolstoi quan sát cuộc sống một cách toàn diện, tinh tế và mô tả nó một cách tài hoa thì đọc Shakespeare, sẽ thấy đó là một festival tất cả trí khôn của con người. Những trí khôn, những mưu mẹo mà Shakespeare mô tả, ví dụ như mô tả ông chú của Hamlet, làm người ta bỗng nhiên thấy Shakespeare vĩ đại vì Shakespeare khôn ngoan trước loài người rất nhiều.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Những quyển sách ấy là những người bạn an ủi tôi và phải nói rằng các tác giả của chúng là thần thánh với tôi. Tôi không có điều kiện để theo bất kỳ tôn giáo nào cả, nhưng tôi có một tôn giáo rất quan trọng và đi theo suốt cuộc đời là vẻ đẹp được thể hiện bởi các tác giả vĩ đại.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Có thể thấy rằng việc đọc sách giúp con người hình thành năng lực nhận biết sự đẹp đẽ của những đối tượng xuất hiện xung quanh đời sống của mình, làm cho miền tinh thần của con người trở nên phong phú. Miền tinh thần không chỉ là các cảm xúc mà miền tinh thần là miền nhận thức. Khi nào con người có một miền tinh thần có chất lượng thì họ đã thay đổi về bản chất, từ một người bị động thưởng thức những thứ mình có trở thành một đối tượng có thể phát hiện và mách bảo. Bất cứ ai muốn trở thành con người hoàn chỉnh thì phải có hiểu biết, phải đọc.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Tuy nhiên, thái độ của chúng ta đối với việc đọc sách cũng là một vấn đề rất đáng lưu ý. Chúng ta đọc một quyển sách không phải để thuộc lòng câu này ai nói, nói năm nào, cũng không phải để biết tác giả ấy đang làm cái gì mà để tìm hiểu cái sáng tạo của anh ta hay ở chỗ nào và mình có thể bắt chước đến mức nào. Bởi vì nhiệm vụ của chúng ta là làm ra cái gì chứ không phải là biết người ta làm cái gì. Cái \"ranh giới giác ngộ\" khi đọc sách là một bức vách bằng kính, nhìn thì trong suốt nhưng nhiều khi không đi qua được. Có nhiều người đọc rất nhiều mà cuối cùng không hiểu, không ngộ ra được, đi qua cái tủ kính mà không vào trong đó được. Lý do rất đơn giản là họ học đủ mọi thứ và trở thành tín đồ của những thứ mà mình học được và họ nhầm lẫn rằng trong sách có tất cả mọi thứ.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Trong cuộc đời có sách chứ không phải trong sách có cuộc đời. Sách là một bộ phận của cuộc đời chứ không phải sách thâu tóm toàn bộ cuộc đời. Nhiều người tưởng rằng sách vở, chữ nghĩa có thể thâu tóm cuộc đời nhưng không phải. Sách vở, chữ nghĩa là một bộ phận, là một lực lượng của cuộc sống, mà con người muốn thành đạt thì phải biết đến nhiều bộ phận như vậy chứ không phải chỉ có một.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Kết luận của tôi là đọc, nghe và nhìn càng nhiều càng tốt. Nhưng đừng vụ lợi khi đọc, đừng vụ lợi khi nghe và đừng vụ lợi khi nhìn. Trước hết hãy làm cho việc đọc, nghe, nhìn trở thành bản năng của con người. Khi nào con người gặp những thất thiệt do không đọc, không nghe, không nhìn thì con người sẽ thức tỉnh.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Tất cả những hoạt động tuyên truyền, cổ vũ cho văn hoá đọc cần phải được xác định với vai trò xây dựng những bản năng đọc của xã hội chứ không phải ý thức đọc. Trong khi đối với xã hội việc đọc, nghe, nhìn là bản năng thì đối với các cơ quan chuyên nghiệp là phải tổ chức một cách có ý thức, nhưng là ý thức của cơ quan ấy để tác động vào bản năng đọc, nghe và nhìn của xã hội.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\">Đừng gây ra áp lực bắt người ta phải đọc, bắt người ta phải nghe, bắt người ta phải nhìn. Và nhất là bắt người ta phải đọc, nghe, nhìn cái này hay cái kia thì càng nguy hiểm hơn.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: &quot;Noticia Text&quot;, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal; text-align: right;\"><strong style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Nguyễn Trần Bạt</strong></p>', 'data:image/jpeg;base64,', '1568768165735', 'tri-tue-cua-con-nguoi188120191568768124372tri-tue-cua-con-nguoi', 1, 3);
INSERT INTO `posts` (`id`, `title`, `description`, `content`, `avartar`, `date_create`, `slug`, `status`, `id_category`) VALUES
(14, 'Trump muốn điều tra hợp đồng viết sách của Obama', 'Trump gợi ý Ủy ban Tư pháp Hạ viện Mỹ nên điều tra các hợp đồng viết sách, làm phim của Obama thay vì nhắm vào ông.', '<h1 class=\"title_news_detail mb10\" style=\"margin-top: 0px; margin-bottom: 10px; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 28px; line-height: 32px; font-family: arial; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-size: 14px; background-color: transparent; display: inline !important;\">Trump gợi ý Ủy ban Tư pháp Hạ viện Mỹ nên điều tra các hợp đồng viết sách, làm phim của Obama thay vì nhắm vào ông.</span><br></h1><article class=\"content_detail fck_detail width_common block_ads_connect\" style=\"margin: 0px; padding: 0px 0px 10px; text-rendering: geometricprecision; width: 500px; float: left; color: rgb(51, 51, 51); font-family: arial;\"><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">\"Ủy ban Tư pháp Hạ viện đã từ bỏ báo cáo của Mueller. Thật buồn cho họ khi bỏ ra 40 triệu USD trong hai năm, nhưng kết quả là không có sự thông đồng hay cản trở nào\", Tổng thống Donald Trump viết trên Twitter hôm 16/9, đề cập tới cuộc điều tra cáo buộc Nga can thiệp bầu cử tổng thống Mỹ của công tố viên đặc biệt Robert Mueller.&nbsp;</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">\"Vì vậy họ quyết định xem xét tất cả thỏa thuận trong suốt cuộc đời Trump. Tôi có ý hay hơn. Hãy điều tra hợp đồng sách của Obama, hoặc thỏa thuận lố bịch với Netflix, sau đó xem xét tất cả thỏa thuận của các nghị sĩ Dân chủ trong quốc hội. Những cuộc điều tra đó sẽ rất nhanh chóng\", Trump viết.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">Vài giờ sau, Trump tiếp tục tung ra một loạt tweet chỉ trích các thành viên đảng Dân chủ. \"Họ đang tìm cách dựng chuyện rằng tôi trở nên giàu có nhờ làm Tổng thống. Tốt thôi, ngoại trừ việc tôi đã mất hàng tỷ USD khi trở thành Tổng thống Mỹ và làm công việc này tốt nhất trong nhiều thập kỷ qua\", ông tuyên bố.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">Trump khẳng định ông là người sẵn sàng chi trả tiền thuê phòng khách sạn hay đổ xăng máy bay tại sân bay không thuộc sở hữu của mình. \"Những thành viên đảng Dân chủ đó thật điên rồ? Netflix của Obama ư?\"</p><table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"margin: 10px auto; padding: 0px; text-rendering: geometricprecision; max-width: 100%; width: 500px;\"><tbody style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><tr style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><td style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; line-height: 0;\"><img alt=\"Tổng thống Mỹ Donald Trump trả lời phóng viên tại Nhà Trắng hôm 16/9. Ảnh: AFP.\" data-natural-h=\"300\" data-natural-width=\"500\" src=\"https://i-vnexpress.vnecdn.net/2019/09/17/000-1KC3K9-4733-1568709341.jpg\" data-width=\"500\" data-pwidth=\"500\" style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; border: 0px; font-size: 0px; line-height: 0; max-width: 100%;\"></td></tr><tr style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><td style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; line-height: 0;\"><p class=\"Image\" style=\"padding: 10px; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: 16px; background: rgb(245, 245, 245);\">Tổng thống Mỹ Donald Trump trả lời phóng viên tại Nhà Trắng hôm 16/9. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">AFP</em>.</p></td></tr></tbody></table><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">Cựu tổng thống Mỹ Barack Obama và vợ Michelle thành lập công ty sản xuất Higher Ground Productions và&nbsp;hồi tháng 4 công bố những sản phẩm do công ty này hợp tác với hãng phim Netflix phát hành.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">Dự án gồm các nội dung đa dạng như loạt phim có kịch bản hay phim tài liệu, theo thông báo Netflix đưa ra trước đó. Thỏa thuận giữa hãng phim này với vợ chồng Obama kéo dài nhiều năm.&nbsp;</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">Trump hồi tháng 7 cũng&nbsp;<a href=\"https://vnexpress.net/the-gioi/trump-keu-goi-dieu-tra-hop-dong-sach-cua-obama-3958940.html\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; color: rgb(0, 79, 139);\">kêu gọi điều tra</a>&nbsp;hợp đồng sách của Obama, nhưng không nêu cụ thể đó là hợp đồng nào. Vợ chồng cựu tổng thống Mỹ từng ký hợp đồng xuất bản sách được cho là trị giá hơn 65 triệu USD với nhà xuất bản Penguin Random House.&nbsp;</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px;\">Cuốn hồi ký đang được Obama hoàn thiện, dự kiến phát hành vào năm 2020, là một phần của hợp đồng này. Bà Michelle năm ngoái cũng xuất bản cuốn hồi ký nổi tiếng có tên \"Becoming\".</p></article>', 'data:image/jpeg;base64,', '1568780502179', 'trump-muon-dieu-tra-hop-dong-viet-sach-cua-obama188120191568768262864trump-muon-dieu-tra-hop-dong-viet-sach-cua-obama', 1, 4);
INSERT INTO `posts` (`id`, `title`, `description`, `content`, `avartar`, `date_create`, `slug`, `status`, `id_category`) VALUES
(15, 'Giá gà rẻ hơn rau', 'Giá gà hơi tại Đồng Nai hiện chỉ hơn chục nghìn đồng một kg, bằng một nửa giá thành khiến nhiều hộ chăn nuôi lỗ tiền tỷ chăn nuôi lỗ tiền tỷ tỷ chăn nuôi lỗ tiề', '<div><p class=\"description\" style=\"margin-top: 10px; margin-bottom: 10px; padding-bottom: 5px; text-rendering: geometricprecision; color: rgb(51, 51, 51); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial;\">Giá gà hơi tại Đồng Nai hiện chỉ hơn chục nghìn đồng một kg, bằng một nửa giá thành khiến nhiều hộ chăn nuôi lỗ tiền tỷ.</p><article class=\"content_detail fck_detail width_common block_ads_connect\" style=\"margin: 0px; padding: 0px 0px 10px; text-rendering: geometricprecision; width: 500px; float: left; color: rgb(51, 51, 51);\"><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Chưa có năm nào giá gà hơi công nghiệp tại Đông Nam Bộ lại xuống thấp như năm nay. Người nuôi gà công nghiệp tại Đồng Nai đang lỗ nặng khi giá gà hơi bán ra chỉ khoảng 11.000-13.000 đồng một kg, thậm chí còn thấp hơn giá một số loại rau. Đây cũng là tình cảnh chung của ngành nuôi gà công nghiệp khu vực phía Nam kể từ đầu năm đến nay.&nbsp;</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Vừa xuất chuồng 30.000 con gà với giá 12.000 đồng một kg, anh Phong ở Đồng Nai cho biết, trang trại của anh lỗ hơn một tỷ đồng cho lứa gà này. Mức giá bán này chỉ xấp xỉ 50% giá thành chăn nuôi (24.000-26.000 đồng một kg).</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Anh Phong giải thích, thông thường một con gà nuôi trưởng thành nặng 3 kg, giá thành phẩm 72.000 đồng một con. Nhưng nếu bán với giá 12.000 đồng một kg như hiện nay thì một con gà anh lỗ 36.000 đồng.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">\"Nếu tình trạng này tiếp tục đến cuối năm nay, tôi có thể bị âm vốn vì không đủ sức để tái đàn\", anh Phong nói.</p><table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"margin: 10px auto; padding: 0px; text-rendering: geometricprecision; max-width: 100%; font-family: arial; width: 500px;\"><tbody style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><tr style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><td style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; line-height: 0;\"><img alt=\"Giá gà hơi lông trắng chỉ ở mức 11.000 -13.000 đồng một kg. Ảnh: Dreamfeed\" data-natural-h=\"304\" data-natural-width=\"500\" src=\"https://i-kinhdoanh.vnecdn.net/2019/09/17/ga-long-trang-1568712486-3754-1568713043.png\" data-width=\"500\" data-pwidth=\"500\" style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; border: 0px; font-size: 0px; line-height: 0; max-width: 100%;\"></td></tr><tr style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\"><td style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; line-height: 0;\"><p class=\"Image\" style=\"padding: 10px; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: 16px; background: rgb(245, 245, 245);\">Giá gà hơi lông trắng chỉ ở mức 11.000 -13.000 đồng một kg. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Dreamfeed</em></p></td></tr></tbody></table><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Cũng có trang trại số lượng lên tới vài chục nghìn con, ông Hòa cho biết, lứa gà này có thể khiến ông lỗ gần 2 tỷ đồng. \"Từ đầu năm giá gà bán ra chỉ bằng với giá thành đã khiến người nuôi khốn đốn, nhưng 2 tuần nay giá gà bỗng lao dốc. Nhiều hộ tốn thêm chi phí thức ăn để cầm chừng đợi giá đi lên nhưng với tình hình này cũng sớm phải bán bán tháo\", ông Hòa bộc bạch.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\"><span style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision; color: rgb(105, 105, 105);\"><strong style=\"margin: 0px; padding: 0px; text-rendering: geometricprecision;\">Không chỉ các hộ chăn nuôi nhỏ, ngay cả những doanh nghiệp chăn nuôi lớn cũng đang gặp không ít thách thức.</strong></span></p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Lãnh đạo một doanh nghiệp chăn nuôi ở Đồng Nai cho biết, cứ 15.000 con gà xuất chuồng là doanh nghiệp lỗ 600 triệu đồng. Do đó, thời điểm này họ buộc phải giảm đàn và tìm các kênh phân phối hợp lý để tăng giá bán, bù lỗ khi giá gà thấp.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Vị này cũng cho biết thêm, cùng với gà công nghiệp, gà tam hoàng, gà ta, gà lai Đông Tảo đang rớt giá mạnh khiến người chăn nuôi lao đao. Nguyên nhân là nguồn cung trong nước dồi dào, cộng thêm nguồn hàng nhập khẩu gia tăng khiến giá lao dốc mạnh.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Thừa nhận giá gà công nghiệp lông trắng xuống mức thấp kỷ lục trong vòng 10 năm trở lại đây, ông Lê Văn Quyết, Phó chủ tịch Hiệp hội Chăn nuôi Đông Nam Bộ cho biết, hầu hết hộ chăn nuôi ngoài hiệp hội đang lỗ lặng, mức lỗ từ vài trăm triệu đồng lên tới 10 tỷ đồng. Riêng với những hộ nằm trong hiệp hội thì vẫn được giá bao tiêu hợp lý ở mức 24.000-26.000 đồng một kg.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Ông Quyết cũng nhắc việc các hộ chăn nuôi gà tăng đàn với kỳ vọng thịt gà sẽ thay thế thịt heo trước tình hình dịch bệnh tả heo châu Phi lan nhanh khiến giá lao dốc. Có thời điểm giá gà công nghiệp tăng lên 35.000-40.000 đồng một kg, người dân đổ dồn chăn nuôi gà với số lượng lớn.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Nguyên nhân khác khiến gà trong nước liên tục đi xuống là lượng gà nhập khẩu đổ về Việt Nam với số lượng lớn giá rẻ.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Theo số liệu thống kê của Tổng cục Hải quan, Việt Nam đã nhập khẩu 142.190 tấn thịt gà với trị giá hơn 120 triệu USD trong nửa đầu năm nay. Như vậy, mỗi kg gà nhập khẩu vào Việt Nam có giá bình quân hơn 19.500 đồng.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Việt Nam nhập khẩu gà chủ yếu từ Mỹ, Hàn Quốc, Hà Lan, Ba Lan, Brazil và Nga. Trong đó, Mỹ là nước xuất khẩu thịt gà lớn nhất vào Việt Nam, với hơn 62.400 tấn, trị giá 48,6 triệu USD.&nbsp;Mức giá bình quân 22.420 đồng một kg của gà Mỹ nhập khẩu vẫn thấp hơn nhiều các sản phẩm gà công nghiệp của Việt Nam.</p><p class=\"Normal\" style=\"margin-bottom: 1em; text-rendering: geometricprecision; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 18px; font-family: arial; letter-spacing: normal;\">Khảo sát ở TP HCM cho thấy, giá gà nhập khẩu rẻ, gà tại trạng trại \"lao dốc\" nhưng giá bán lẻ tại các cơ sở kinh doanh và siêu thị vẫn giữ nguyên giá ở mức cao, thậm chí có thời điểm còn tăng giá bán. Điều này cũng là một phần nguyên nhân không kích cầu được nhu cầu tiêu dùng, khiến gà tồn trong các trang trại tăng cao.</p><div><br></div></article></div>', 'data:image/png;base64,', '1571226031078', 'gia-ga-re-hon-rau188120191568768651537gia-ga-re-hon-rau', 1, 5);
INSERT INTO `posts` (`id`, `title`, `description`, `content`, `avartar`, `date_create`, `slug`, `status`, `id_category`) VALUES
(16, 'Nội tâm bí ẩn', 'Trong một buổi vừa chơi khúc côn cầu vừa đàm đạo, tôi và một giáo sĩ Do Thái đã thử tìm một từ có thể gói gọn sự thông thái của con người. Anh ấy đề nghị từ tim', 'rong một buổi vừa chơi khúc côn cầu vừa đàm đạo, tôi và một giáo sĩ Do Thái đã thử tìm một từ có thể gói gọn sự thông thái của con người. Anh ấy đề nghị từ timshel trong tiếng Do Thái, vốn xuất nguồn từ sách Sáng Thế Ký – quyển đầu của kinh Cựu Ước. T Sau khi bị đuổi khỏi vườn địa đàng, Adam và Eva sinh được hai người con trai. Người con trai lớn tên là Cain. Đây chính là người đầu tiên được sinh ra bên ngoài thiên đường. Thời gian trôi qua, Cain lớn lên và cấy cày trồng trọt rồi mang tặng Thượng Đế những quả ngọt đầu mùa. Món quà bị từ chối. Đức Jehovah giải thích với Cain rằng đó là do cuộc sống của anh đang bị quỷ dữ quấy phá – chúng lởn vởn ngay cửa nhà anh. “Nhưng con có thể chiến thắng quỷ dữ và có cuộc sống đầy đủ, sung túc”, Đức Jehovah nói. Câu cuối cùng đó của Chúa có ý nghĩa hết sức quan trọng: “Con có thể chiến thắng quỷ dữ và có cuộc sống đầy đủ, sung túc”. Từ cốt lõi ở đây chính là “có thể”. Đây là timshel trong tiếng Do Thái. Từ này đã khiến bao học giả và các nhà thần học đau đầu trong suốt một thời gian dài. Từ này nằm ở giữa đoạn được xem là một trong năm đoạn khó dịch và khó hiểu nhất của Kinh Thánh. Tùy theo ngữ cảnh mà từ này có nhiều nghĩa khác nhau, đặc biệt là trong cuộc trò chuyện trên giữa Cain và Jehovah. Timshel được dịch thành “con phải”, tức là một chỉ thị, một mệnh lệnh. Timshel được dịch thành “con sẽ” hàm ý muốn nói đến sự tiền định. Thậm chí timshel còn được hiểu là “con không thể”, cho thấy một sự bất lực đầy tuyệt vọng. Tất cả những cách dịch đó đều thể hiện một mối quan hệ ràng buộc không mấy tự do với Thượng Đế. Anh bạn giáo sĩ của tôi thì cảm thấy nghĩa thiết thực của đoạn Kinh Thánh kia gắn liền với sự sống, nghĩa là “Đừng chết” hoặc “Đừng thụ động để rồi thành nạn nhân – phải chủ động – phải sống”. Và anh đọc thấy trong đó một lờikhuyên hữu ích: quỷ dữ đang quấy rối, bạn nên đấu tranh với chúng. Hay nói xa thêm một chút nữa thì, nếu bạn nên, bạn sẽ có thể. Khi hiểu từ timshel theo nghĩa “có thể” là ta muốn nói đến một khả năng chọn lựa nhất định. Thế là không cần phải vò đầu bứt tóc nữa. Theo tôi, cứ hiểu theo nghĩa “ít nhất thì loài người cũng có thể hành động theo khả năng của mình” là hợp lý nhất, tức là hành động như thể chúng ta hoàn toàn có thể nắm giữ số phận trong tay mình. Cho dẫu có nghĩ gì, tin gì thì chính những điều chúng ta làm đã tạo nên số phận của chúng ta. Bạn không cần phải là nhà thần học hay thuộc một nhóm tôn giáo đặc biệt nào mới được phép tham gia vào cuộc trao đổi này, bởi hẳn đâu đó trong đời mình, bạn đã từng đối diện vấn đề này. Và tôi tin rằng bằng cách này hay cách khác, bạn đã từng trải nghiệm chân lý đó. Trong ngôn ngữ hiện đại, timshel mang nghĩa “có thể”, hay “chắc vậy”, “biết đâu đấy”. Có thể. Chúng ta chọn từ này. Bởi đó là câu trả lời khôn ngoan nhất đối với hầu hết mọi câu hỏi. Bởi đó là từ đưa chúng ta đến những cánh cửa rộng mở, những chân trời bao la. Tôi không tin rằng ý nghĩa cuộc sống là một câu đố hóc búa mà chúng ta phải đi tìm lời giải. Cuộc sống tồn tại. Bản thân tôi tồn tại. Và bất cứ điều gì cũng có thể xảy ra. Tôi tin rằng tôi có thể tạo ra ý nghĩa cho cuộc đời mình. Còn điều có thể không kia hóa ra lại là một phước lành. Nếu tôi hoàn toàn chắc chắn về mọi thứ, tôi sẽ sống một cuộc đời đầy đau khổ lo âu, lúc nào cũng sợ bị lạc lối. Nhưng bởi mọi thứ và mọi việc đều có thể xảy ra nên cuộc sống mới luôn chứa đựng những điều kỳ diệu bất tận.<br>', 'data:image/png;base64,', '1570292267671', 'noi-tam-bi-an59120191570292131242noi-tam-bi-an', 1, 2);

